/**
 * Returns the length of the array, items,
 * by using a single call to reduce.
 */
function len(items) {
    return items.reduce(function(acc, cur, curInd) { return curInd + 1; });
}

/**
 * Takes an array of numbers and returns an array of size 2,
 * where the first element is the smallest element in items,
 * and the second element is the largest element in items.
 *
 * Must do this by using a single call to reduce.
 *
 * For example, minMax([4, 1, 2, 7, 6]) returns [1, 7]
 */
function minMax(items) {
    return items.reduce(function(acc, cur)
        {
            acc = [Math.min(acc[0], cur), Math.max(acc[1], cur)];
            return acc;
        }, 
    [0, 0]);
}

/**
 * Takes an array of items, and returns a Map with the
 * frequencies (counts) of each item in the array.
 *
 * Must do this by using a single call to reduce.
 *
 * For example,
 *    freqs([1, 2, 3, 2, 7, 2, 1]) returns Map {1 => 2, 2 => 3, 3 => 1, 7 => 1}
 *    freqs("One fish two fish red fish blue fish".split(' '))
 *         returns Map {"One" => 1, "fish" => 4, "two" => 1, "red" => 1, "blue" => 1}
 */
function freqs(items) {
    return items.reduce(function(acc, cur)
        {
            if (acc.has(cur))
            {
                acc.set(cur, acc.get(cur) + 1);
            }
            else
            {
                acc.set(cur, 1);
            }
        
            return acc;
        },
    new Map());
}

/** Takes in a map of [int, int] and converts all values to percentages using reduce and map.**/
function toPercentages(inMap)
{
    // return [...inMap];
    let arr = [...inMap];
    let totalElements = arr.reduce(function(acc, cur) 
                            {
        let x = [cur[0], acc[1] + cur[1]];
        // console.log(x);
        return x;
    }, [0, 0])[1];
    
    // console.log('Total Elements:  ' + totalElements);
    
    return new Map(arr.map(x => [x[0], x[1] / totalElements * 100]));
}

/**
 * Takes as input a string containing numbers separated by newlines (see data below).
 * Uses string split, and then map, filter, and reduce solely to compute 
 * the frequency, as a Map, of the first digit of each number 
 * (except for numbers starting with 0).  
 * It must throw away numbers that start with 0 and blank entries.
 * The returned Map must contain numbers as keys -- NOT strings containing numbers!
 *
 * For example, benford(sample1) returns Map {1 => 3, 2 => 2, 3 => 2, 7 => 2, 9 => 1}
 *              benford(sample2) returns Map {1 => 3, 2 => 2, 3 => 2, 7 => 2, 9 => 1}
 */
function benford(strNums) {
    return strNums.split('\n').map(curStr => parseInt(curStr.charAt(0))).filter(
        function(cur) 
        {
            return cur === cur && cur !== 0;
        } ).reduce(function(acc, cur)
        {
            if (acc.has(cur))
            {
                acc.set(cur, acc.get(cur) + 1);
            }
            else
            {
                acc.set(cur, 1);
            }
        
            return acc;
        },
    new Map());
}

